import React, { Component } from "react";
import logo from "../images/logo.png";
import profilePic from "../images/profilePic.svg";
class NavBar extends Component {
  getNavBarClass() {
    const { isHorizontal } = this.props;

    return isHorizontal === false
      ? "navbar navbar-light bg-light"
      : "navbar navbar-expand-lg navbar-light bg-light";
  }

  render() {
    return (
      <div>
        <nav
          className={this.getNavBarClass()}
          style={{
            borderBottom: "0.5px solid #9E9E9E"
          }}
        >
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarTogglerDemo03"
            aria-controls="navbarTogglerDemo03"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon" />
          </button>
          <a className="navbar-brand">
            <img
              src={logo}
              width="70"
              height="70"
              className="d-inline-block align-center"
              alt="logo"
            />
          </a>
          <div className="collapse navbar-collapse" id="navbarTogglerDemo03">
            <form className="form-inline ml-auto my-2 my-lg-2">
              <input
                className="form-control mr-lg-2"
                type="search"
                placeholder="Search for a robot"
                aria-label="Search"
              />
            </form>
          </div>
          <div className="media">
            <img
              src={profilePic}
              className="mr-3"
              height="40"
              width="50"
              alt="profilePic"
              style={{
                borderRadius: "0.3px solid #9E9E9E"
              }}
            />
          </div>
        </nav>
      </div>
    );
  }
}

export default NavBar;
